import React from 'react';
import "./style.css";
import {Link} from 'react-router-dom';

const SignUp = (props)=> {
	return (
		<div>
			<h1>ACCOUNT CREATION</h1>

			<form>
				<label>First Name</label><br/>
				<input value = {props.username} onChange = {props.handleChange} name='name' type='name' placeholder = 'first name here'/>
				<br />
				<label>Last Name</label><br/>
				<input name='name' type='password' value = {props.password} onChange = {props.handleChange} />
				<br />
				<button type = 'submit' name = "/auth/signup" onClick = {props.handleSubmit}>Sign Up</button>
			</form>
		</div>
	);
};

export default SignUp;
